import {readUser} from "../../Services/UserService.js";
export default function UsersListItem(props){

    console.log(props);
    const readCurrUser = () =>{
        readUser(props.objectId);
        document.getElementById("user-email").innerHTML = "what"
    }

    return (
        <div>
            Name: {props.username} 
            <br></br>
            Email: <span id="user-email"></span>
            <br></br>
            <button onClick={readCurrUser}>Delete this user</button>
        </div>
    )
}
